How to read data from Mongodb which have duplicate element name in c#<p>I am using <code>MongoDB.Drivers</code> in my C# MVC application to communicate with Mongodb database.</p>

<p><strong>C# Code</strong></p>

<pre><code>            var client = new MongoClient("mongodb://localhost:27012");
            var db = client.GetDatabase("Test_DB");
            var collection = db.GetCollection&lt;BsonDocument&gt;("TestTable");
            var tData = await collection.FindAsync(new BsonDocument(true)); // I used - new BsonDocument(true)  to specify allow duplicate element name while read data.
</code></pre>

<p><strong>MongoDB Data Pic</strong>
<a href="https://i.stack.imgur.com/9VmF3.png" rel="noreferrer"><img src="https://i.stack.imgur.com/9VmF3.png" alt="enter image description here"></a></p>

<p>In above image you can see I have multiple Columns called <code>DuplicateCol</code> with different values. 
When I tried to read these data in <code>c#</code> using <code>MongoDB.Driver</code> I got following error : <code>InvalidOperationException: Duplicate element name 'DuplicateCol'.</code> </p>

<p>While insert duplicate element name I used <code>AllowDuplicateNames=true</code> of <code>BsonDocument</code> object as below. (It insert duplicate element name without error.)</p>

<pre><code>BsonDocument obj = new BsonDocument();
obj.AllowDuplicateNames = true;
obj.Add("DuplicateCol", "Value_One");
obj.Add("propone", "newVal");
obj.Add("DuplicateCol", "Value_Two");
.... // other properties with value 
await collection.InsertOneAsync(obj);
</code></pre>

<p><strong>Note:</strong> This Schema is Must. I can not altered it.</p>

<p>Please provide me suggestions to fix this Issue.
Any help would be highly appreciated..</p>

<p>Thanks. </p>

