The right way to connect to query database mongodb multiples times<p>im building a website in my free time using nodejs/Handlebars.js/mongodb(mongoose),
i didnt study any web developement lessons, and i dont know  the right way to do things efficiently and securely.
so in this project, i stumbled upon a problem where i had to query in the database if email already exists or no if it does, it queries again if the username already exists or not, if it does exists the user can be registred to the databse. yes it gets the job done but im not satisfyied with this approach, it seems to be unprofessional and not secure.
so can you please tell me the right way to do it ?</p>

<p><strong>this is the part where i think i ve done it the wrong way</strong></p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>	//check for errors in Req.validation and push them to errors Array
if(valErrors){
	for (var i = 0; i &lt; valErrors.length; i++) {
	 	errors.push(valErrors[i])
	}
}
//check if the username submitted exists in the database 
User.findOne({'username':username}, function (err, user) {		
	if(user)
		{
			errors.push({msg:"username is already in use!"})				
			res.render('user/register',{
				errors:errors
			});
		}
        //if the username is not in use already check if the email is in 
        //use 
		else {
			User.findOne({'email':email}, function (err, user) {
				if(user){
					errors.push({msg:'email is already in use !'})		
					res.render('user/register',{
						errors:errors
					});			
				}	//if the email doesnt exists too then register this //user
				else{
					var coins = new Coins()
					var newUser = new User({
					name: name,
					email:email,
					username: username,
					password: password,
					coins:coins.encryptcoins('0'),
					joindate:getDate()
					});

					User.createUser(newUser, function(err, user){
						if(err) throw err;		
					});
					req.flash('success_msg', 'You are registered and can now login');
					res.redirect('/user/login');
					}	
				

			});
		}
});
		
})</code></pre>
</div>
</div>

<strong>EDIT:</strong>
<strong>user Schema</strong></p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>var mongoose = require('mongoose');
var bcrypt = require('bcryptjs');

// User Schema
var UserSchema = mongoose.Schema({
	username: {
		type: String,
		index:true,
		required:true
	},
	password: {
		type: String,
		required:true
	},
	email: {
		type: String,
		required:true
	},
	name: {
		type: String,
		required:true
	},
	coins: {
		type:String,
		required:true
	},
	joindate: {
		type:String,
		required:true
	},
	orders: {
		type:Array,
		required:false
	}
},{collection:'Users'});

var User = module.exports = mongoose.model('User', UserSchema);

module.exports.createUser = function(newUser, callback){
	bcrypt.genSalt(10, function(err, salt) {
	    bcrypt.hash(newUser.password, salt, function(err, hash) {
	        newUser.password = hash;
	        newUser.save(callback);
	    });
	});

}

module.exports.getUserByUsername = function(username, callback){
	var query = {username: username};
	User.findOne(query, callback);
}

module.exports.getUserById = function(id, callback){
	User.findById(id, callback);
}

module.exports.comparePassword = function(candidatePassword, hash, callback){
	bcrypt.compare(candidatePassword, hash, function(err, isMatch) {
    	if(err) throw err;
    	callback(null, isMatch);
	});
}</code></pre>
</div>
</div>
</p>

<p><strong>this is the whole code</strong></p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>var express = require('express');
var router = express.Router();
var passport = require('passport');
var LocalStrategy = require('passport-local').Strategy;
var User = require('../models/users');
const ensureLoggedIn = require('connect-ensure-login').ensureLoggedIn();
const ensureLoggedOut = require('connect-ensure-login').ensureLoggedOut();
var Coins = require('../models/coins');
// Register
router.get('/register',ensureLoggedOut, function(req, res){
	res.render('user/register');
});

// Login
router.get('/login',ensureLoggedOut, function(req, res){
	res.render('user/login');
});

// Register User
router.post('/register', function(req, res){
	var name = req.body.name;
	var email = req.body.email;
	var username = req.body.username;
	var password = req.body.password;
	var password2 = req.body.password2;

	console.log(email)
	console.log(username)
	// Validation
	req.checkBody('name', 'Name is required').notEmpty();
	req.checkBody('email', 'Email is required').notEmpty();
	req.checkBody('email', 'Email is not valid').isEmail();
	req.checkBody('username', 'Username is required').notEmpty();
	req.checkBody('password', 'Password is required').notEmpty();
	req.checkBody('password2', 'Passwords do not match').equals(req.body.password);

	//Error handling
	var errors = [];
	var valErrors = req.validationErrors()
	//check for errors in Req.validation and push them to errors Array
	if(valErrors){
		for (var i = 0; i &lt; valErrors.length; i++) {
		 	errors.push(valErrors[i])
		}
	}
    //check if the username submitted exists in the database 
	User.findOne({'username':username}, function (err, user) {		
		if(user)
			{
				errors.push({msg:"username is already in use!"})				
				res.render('user/register',{
					errors:errors
				});
			}
            //if the username is not in use already check if the email is in 
            //use 
			else {
				User.findOne({'email':email}, function (err, user) {
					if(user){
						errors.push({msg:'email is already in use !'})		
						res.render('user/register',{
							errors:errors
						});			
					}	//if the email doesnt exists too then register this //user
					else{
						var coins = new Coins()
						var newUser = new User({
						name: name,
						email:email,
						username: username,
						password: password,
						coins:coins.encryptcoins('0'),
						joindate:getDate()
						});

						User.createUser(newUser, function(err, user){
							if(err) throw err;		
						});
						req.flash('success_msg', 'You are registered and can now login');
						res.redirect('/user/login');
						}	
					

				});
			}
	});
			
})


passport.use(new LocalStrategy(
	function(username, password, done) {
		User.getUserByUsername(username, function(err, user){
			if(err) throw err;
			if(!user){
				return done(null, false, {message: 'Unknown User'});
			}

			User.comparePassword(password, user.password, function(err, isMatch){
				if(err) throw err;
				if(isMatch){
					return done(null, user);

				} else {
					return done(null, false, {message: 'Invalid password'});
				}
			});
		});
	}));

passport.serializeUser(function(user, done) {
	done(null, user.id);
});

passport.deserializeUser(function(id, done) {
	User.getUserById(id, function(err, user) {
		done(err, user);
	});
});

router.post('/login',
	passport.authenticate('local', {successReturnToOrRedirect: '/', failureRedirect:'/user/login',failureFlash: true}),
	function(req, res) {
		res.redirect('/');
	});

router.get('/logout',ensureLoggedIn, function(req, res){
	req.logout();
	req.session.destroy();
	res.redirect('/');

});

module.exports = router;








function getDate(){
	var d = new Date()
	return ("date: "+d.getDate()+"/"+(d.getMonth()+1)+"/" +d.getFullYear() + " time GMT+1: "+(d.getHours()+1)+":"+(d.getMinutes())).toString()
}









// replaced with Ensure loging in library !
// function ensureLoggedIn(req, res, next) {	
//   if(req.user){
//     return next()
//   }else{
//     res.redirect('/user/login');
//   }
// }
// function ensureLoggedOut(req, res, next) {	
//   if(!req.user){
//     return next()
//   }else{
//     res.redirect('/');
//   }
// }</code></pre>
</div>
</div>
</p>

