How to set MongoDB Change Stream 'OperationType' in the C# driver?<p>When running the new MongDB Server, version 3.6, and trying to add a Change Stream watch to a collection to get notifications of new inserts and updates of documents, I only receive notifications for updates, not for inserts.</p>

<p>This is the default way I have tried to add the watch:</p>

<pre><code>IMongoDatabase mongoDatabase = mongoClient.GetDatabase("Sandbox");
IMongoCollection&lt;BsonDocument&gt; collection = mongoDatabase.GetCollection&lt;BsonDocument&gt;("TestCollection");
var changeStream = collection.Watch().ToEnumerable().GetEnumerator();
changeStream.MoveNext();
var next = changeStream.Current;
</code></pre>

<p>Then I downloaded the C# source code from MongoDB to see how they did this. Looking at their test code for change stream watches, they create a new document(Insert) and then change that document right away(Update) and THEN set up the Change Stream watch to receive an 'update' notification.
No example is given on how to watch for 'insert' notifications.</p>

<p>I have looked at the Java and NodeJS examples, both on MongoDB website and SO, which seems to be straight forward and defines a way to see both Inserts and Updates:</p>

<pre><code>var changeStream = collection.watch({ '$match': { $or: [ { 'operationType': 'insert' }, { 'operationType': 'update' } ] } });
</code></pre>

<p>The API for the C# driver is vastly different, I would have assumed they would have kept the same API for C# as Java and NodeJS. I found no or very few examples for C# to do the same thing.</p>

<p>The closest I have come is with the following attempt but still fails and the documentation for the C# version is very limited (or I have not found the right location). Setup is as follows:</p>

<pre><code>String json = "{ '$match': { 'operationType': { '$in': ['insert', 'update'] } } }";
var options = new ChangeStreamOptions { FullDocument = ChangeStreamFullDocumentOption.UpdateLookup };

PipelineDefinition&lt;ChangeStreamDocument&lt;BsonDocument&gt;, ChangeStreamDocument&lt;BsonDocument&gt;&gt; pipeline = new EmptyPipelineDefinition&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;().Match(Builders&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;.Filter.Text(json,"json"));
</code></pre>

<p>Then running the statement below throws an Exception: </p>

<blockquote>
  <p>{"Command aggregate failed: $match with $text is only allowed as the
  first pipeline stage."}</p>
